import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Text, View } from 'react-native';



export default function App() {
	return (
		<View style={{ paddingTop: 50 }}>
			<Button title="Aperte-me" onPress={() => Alert.alert('Botão pressionado')}/>
			<Button title="Aperte-me" color="#f194ff" onPress={() => Alert.alert('Botão com cor diferente pressionado')}/>
			<Button title="Aperte-me" disabled onPress={() => Alert.alert('Não pode pressionar esse')}/>
		</View>
	);
}








